import React, { useState } from "react";

const booksData = [
  {
    id: 1,
    title: "Atomic Habits",
    author: "James Clear",
    genre: "Self Help",
    rating: 4.8,
    cover: "data:image/jpeg;base64,",
  },
  {
    id: 2,
    title: "The Alchemist",
    author: "Paulo Coelho",
    genre: "Fiction",
    rating: 4.6,
    cover: "data:image/jpeg;base64,",
  },
  {
    id: 3,
    title: "Deep Work",
    author: "Cal Newport",
    genre: "Productivity",
    rating: 4.7,
    cover: "data:image/jpeg;base64,",
  },
  {
    id: 4,
    title: "Rich Dad Poor Dad",
    author: "Robert Kiyosaki",
    genre: "Finance",
    rating: 4.5,
    cover: "data:image/jpeg;base64,",
  },
];

const AllBooks = () => {
  const [search, setSearch] = useState("");
  const [genre, setGenre] = useState("All");

  const genres = ["All", "Self Help", "Fiction", "Productivity", "Finance"];

  const filteredBooks = booksData.filter((book) => {
    const matchSearch =
      book.title.toLowerCase().includes(search.toLowerCase()) ||
      book.author.toLowerCase().includes(search.toLowerCase());

    const matchGenre = genre === "All" || book.genre === genre;

    return matchSearch && matchGenre;
  });

  return (
    <section className="min-h-screen  px-6 md:px-16 py-12">
      {/* Header */}
      <div className="text-center max-w-2xl mx-auto mb-10">
        <h2 className="text-4xl font-heading text-textDark mb-3">
           Explore Books
        </h2>
        <p className="text-textDark/70">
          Browse our curated collection and find your next favorite read.
        </p>
      </div>

      {/* Filters */}
      <div className="flex flex-col md:flex-row gap-4 justify-between mb-10">
        {/* Search */}
        <input
          type="text"
          placeholder="Search by title or author..."
          className="w-full md:w-1/2 p-3 rounded-lg border outline-none"
          value={search}
          onChange={(e) => setSearch(e.target.value)}
        />

        {/* Genre Filter */}
        <select
          className="p-3 rounded-lg border"
          value={genre}
          onChange={(e) => setGenre(e.target.value)}
        >
          {genres.map((g) => (
            <option key={g}>{g}</option>
          ))}
        </select>
      </div>

      {/* Books Grid */}
      {filteredBooks.length > 0 ? (
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-8">
          {filteredBooks.map((book) => (
            <div
              key={book.id}
              className="bg-secondary rounded-2xl shadow-lg p-4 hover:shadow-xl transition"
            >
              <img
                src={book.cover}
                alt={book.title}
                className="rounded-lg mb-4 h-75 w-full object-center"
              />

              <h3 className="font-heading text-lg text-textDark">
                {book.title}
              </h3>
              <p className="text-sm text-textDark/70 mb-1">
                by {book.author}
              </p>

              <div className="flex items-center justify-between mt-2">
                <span className="text-sm bg-accent px-3 py-1 rounded-full font-semibold">
                   {book.rating}
                </span>

                <button className="text-sm font-semibold text-primary hover:underline">
                  View Details 
                </button>
              </div>
            </div>
          ))}
        </div>
      ) : (
        <p className="text-center text-textDark/70">
          No books found matching your criteria.
        </p>
      )}
    </section>
  );
};

export default AllBooks;
